● Revisão de Gramática: processos sintagmáticos (sentenças, orações e períodos), tipos de verbos com concordância e sem concordância, advérbios e classificadores, adjetivos descritivos, e vocabulários de situações de diálogos; 
● Libras em contexto e vocabulários 
● Sinais relacionados aos meios de comunicação e trabalho; 
● Prática com atividades
